import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

class Home extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return <div>
            <h3>Home Page</h3>
        </div>
    }
}

export default () => (
    <div>
       <Router>
            <Route component={Home} />
       </Router>
   </div>
 );
